import React from 'react'

import '../navBarAdd/navBarAddStyle.css'

const NavBarAdd = () => {
  return (
    <div className='navBarAdd'>
      <input className='navBarAddInput' placeholder='Add new list'></input>
      <button className='navBarAddBtn'>clear</button> 
    </div>
    
  )
}

export default NavBarAdd
